import React, { useEffect } from 'react'

function ApproveDoc() {
    useEffect(() => {
        axiosInstance
          .post(`/viewGyms`)
          .then((res) => {
            console.log(res, "gym");
            if (res.data.msg == "No Data obtained ") {
              setgdata([]);
            } else {
              setgdata(res.data.data);
            }
          })
          .catch((err) => {
            console.log(err);
          });
      }, []);
  return (
    <div className="productdiv1" >ApproveDoc</div>
  )
}

export default ApproveDoc
